import {Link} from "react-router-dom"
export const Navbar = () => {
  return (
    <div>
      <div className="navbar">
        <img
          src="https://cdn-icons-png.flaticon.com/512/3176/3176363.png"
          alt="logo"
          onClick={() => window.location.replace("/")}
        />

        <nav>
          <Link>Home</Link>
        </nav>
      </div>
    </div>
  );
};
